event_description:
On April 10, 2020, Louisiana Governor "announced the creation of the Louisiana COVID-19 Health Equity Task Force, which will look at how health inequities are affecting communities that are most impacted by the coronavirus.

Groups that will participate in the task force include:

Southern University’s Nelson Mandela School of Public Policy;
Xavier University’s Department of Public Health Sciences;
Health Science Centers at LSU and Tulane;
LDH Office of Public Health;
LDH Bureau of Minority Health Access;
Pennington Biomedical Research Center;
Schools of Nursing at all of Louisiana’s universities

The immediate assignment is to make sure communities with health disparities are blanketed with good information on COVID-19 safety and prevention; provide the medical community with best practices and protocols for treating communities with underlying medical conditions and health disparities; and ensure testing availability and ease of access for all communities. This Task Force will begin its work immediately and their research will result in the creation of a Dashboard on Health Equity."

Head of State Idriss Déby "set up a health crisis management committee (CGCS) in Chad on Friday. Its mission is to:
- define and implement the national management strategy for the Covid-19 pandemic;
- Guide, coordinate, monitor, evaluate and adapt all the interventions of the actors involved in the management of the health crisis;
- In general, take all appropriate measures to fight the Covid-19 pandemic, as well as its consequences and ensure its monitoring throughout the territory;
- Ensure the effective implementation and monitoring of social support and economic support measures." 

Committee is supposed to take affect on the week proceeding May 15th. Will be under the supervision of the president and the Cabinet Ministers.

California, United States
Until we build immunity, our actions will be aligned to achieve the following:

    Ensure our ability to care for the sick within our hospitals;
    Prevent infection in people who are at high risk for severe disease;
    Build the capacity to protect the health and well-being of the public; and
    Reduce social, emotional and economic disruptions

California’s six indicators for modifying the stay-at-home order are:

    The ability to monitor and protect our communities through testing, contact tracing, isolating, and supporting those who are positive or exposed;
    The ability to prevent infection in people who are at risk for more severe COVID-19;
    The ability of the hospital and health systems to handle surges;
    The ability to develop therapeutics to meet the demand;
    The ability for businesses, schools, and child care facilities to support physical distancing; and
    The ability to determine when to reinstitute certain measures, such as the stay-at-home orders, if necessary.

