Guyana announces its first COVID case in the country on 11th March 2020. The president in his statement advised: 
-public gatherings be discouraged;
-non-essential travel be discouraged;
-competent agencies continue to patrol irregular border crossings; and
-enhanced sensitization of key personnel at all air and seaports is to continue.

He further mentioned that: "Screening remains in place for those persons arriving from high-risk countries. Seven countries – Jamaica, Dominican Republic, Brazil, French Guiana, Panama, St. Vincent and the United States of America – have been added to the list of eight (People’s Republic of China, Italy, South Korea, Singapore, Japan, Thailand, Malaysia and Iran) that was previously made public."

(Italy) Campania province issued ordinance n°48 on May 17, 2020:


- commercial activities, like: "personal services" (hairdressers, barbers, beauty centers ..), retail commercial activities, bars (with counter service, not yet at tables) reopen. Restaurants will open again from May 21st;

- museums and libraries reopen;

- swimming-pools and gyms are closed until May 25th;

- obligation of the outdoor masks confirmed.

On May 14, 2020, effective from May 15, 2020 0:00 JST until further notice, the outreach of PRC testing measures has been extended to include arrivals from the following countries:
- Central Asia: Azerbaijan, Kazakhstan;
- Asia: Maldives;
- Central/South America: Uruguay, Colombia, Bahamas, Honduras, Mexico;
- Africa: Cabo Verde, Gabon, Guinea-Bissau, São Tomé und Príncipe, Equatorial Guinea.
